import React from 'react';
import styled from 'styled-components';
import { img } from '../assets/img.svg';

const Box = styled.div``;
const Title = styled.h2``;

function Hero() {
  return (
    <Box>
      <Title></Title>
    </Box>
  );
}

export default Hero;
